import React from "react";
import fetImg from '../Assets/asset 5.jpg'

const Feature = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md-4">

          </div>
          <div className="col-md-4">
        <img src={fetImg} alt="" />
          </div>
          <div className="col-md-4">

          </div>
        </div>
      </div>
    </>
  );
};

export default Feature;
